var MongoClient = require('mongodb').MongoClient

MongoClient.connect('mongodb://localhost:30001/mesclients', function (err, db) {
  if (err) throw err

  db.collection('mesclients').find().toArray(function (err, result) {
    if (err) throw err

    console.log(result)
  })
})
